var newMonthExpenditurePlan = async () => {
  const archivePlan = await getDataArchiveFile("Archive expenditure plan");
  if (archivePlan.status === "error")
    return { status: "error", error: archivePlan.error };
  if (archivePlan.jsonData === void 0)
    return { status: "error", error: new Error("Archive expenditure plan data is undefined") };
  if (archivePlan.jsonData === null)
    return { status: "success" };
  if (archivePlan.content === void 0)
    return { status: "error", error: new Error("Archive expenditure plan content is undefined") };
  const expensePlan = await getDataFile("Expenditure plan");
  if (expensePlan.status === "error")
    return { status: "error", error: expensePlan.error };
  if (expensePlan.file === void 0)
    return { status: "error", error: new Error("Expenditure plan file is undefined") };
  if (archivePlan.jsonData.length > 0) {
    try {
      const data = archivePlan.jsonData.map((obj) => ({ ...obj, amount: 0 }));
      const dataStr = JSON.stringify(data, null, 4);
      const newContent = archivePlan.content.replace(/```json[\s\S]*?```/, "```json\n" + dataStr + "\n```");
      await MainPlugin.instance.app.vault.modify(expensePlan.file, newContent);
      return { status: "success" };
    } catch (error) {
      return { status: "error", error: error instanceof Error ? error : new Error(`Failed to create new month expenditure plan: ${String(error)}`) };
    }
  } else {
    return { status: "success" };
  }
};
