var deleteHistory = async (element) => {
  if (element === null || element === void 0)
    return { status: "error", error: new Error("Element is null or undefined") };
  const historyData = await getDataFile("History");
  if (historyData.status === "error")
    return { status: "error", error: historyData.error };
  if (historyData.file === null || historyData.file === void 0)
    return { status: "error", error: new Error("History file is null or undefined") };
  if (historyData.content === null || historyData.content === void 0)
    return { status: "error", error: new Error("History content is null or undefined") };
  if (historyData.jsonData === null || historyData.jsonData === void 0)
    return { status: "error", error: new Error("History data is null or undefined") };
  if (element.type === "expense") {
    const result = await expenditureTransaction(element, "remove");
    if (result.status === "error")
      return { status: "error", error: result.error };
  } else if (element.type === "income") {
    const result = await incomeTransaction(element, "remove");
    if (result.status === "error")
      return { status: "error", error: result.error };
  } else {
    return { status: "error", error: new Error("Unknown transaction type") };
  }
  if (historyData.jsonData.length <= 1) {
    try {
      const newContent = historyData.content.replace(/```json[\s\S]*?```/, "```json\n```");
      await MainPlugin.instance.app.vault.modify(historyData.file, newContent);
      return { status: "success" };
    } catch (error) {
      return { status: "error", error: error instanceof Error ? error : new Error(`Error deleting item: ${String(error)}`) };
    }
  } else {
    try {
      const newData = historyData.jsonData.filter((item) => item.id !== element.id);
      const dataStr = JSON.stringify(newData, null, 4);
      const newContent = historyData.content.replace(/```json[\s\S]*?```/, "```json\n" + dataStr + "\n```");
      await MainPlugin.instance.app.vault.modify(historyData.file, newContent);
      return { status: "success" };
    } catch (error) {
      return { status: "error", error: error instanceof Error ? error : new Error(`Error deleting item: ${String(error)}`) };
    }
  }
};
var deletePlan = async (item) => {
  const { id, name, emoji, type } = item;
  if (!id)
    return { status: "error", error: new Error("Element not found") };
  const sourceMap = {
    expense: () => getDataFile("Expenditure plan"),
    income: () => getDataFile("Income plan")
  };
  try {
    const loader = sourceMap[type];
    if (!loader)
      return { status: "error", error: new Error("Element not found") };
    const data = await loader();
    if (data.status === "error")
      return { status: "error", error: data.error };
    if (data.file === null || data.file === void 0)
      return { status: "error", error: new Error("History file is null or undefined") };
    if (data.content === null || data.content === void 0)
      return { status: "error", error: new Error("History content is null or undefined") };
    if (data.jsonData === null || data.jsonData === void 0)
      return { status: "error", error: new Error("History data is null or undefined") };
    if (await checkForDeletionData(id, "plan"))
      return { status: "error", error: new Error(`The category ${emoji} \u2022 ${name} cannot be deleted because it is used in history.`) };
    let newContent;
    if (data.jsonData.length <= 1) {
      newContent = data.content.replace(/```json[\s\S]*?```/, "```json\n```");
    } else if (data.jsonData.length >= 2) {
      const newData = data.jsonData.filter((item2) => item2.id !== id);
      const dataStr = JSON.stringify(newData, null, 4);
      newContent = data.content.replace(/```json[\s\S]*?```/, "```json\n" + dataStr + "\n```");
    } else {
      newContent = "Error";
    }
    if (newContent === "Error")
      return { status: "error", error: new Error("Error with create new content") };
    await MainPlugin.instance.app.vault.modify(data.file, newContent);
    if (type === "expense") {
      const resultArchive = await archiveExpenditurePlan();
      if (resultArchive.status === "error")
        return { status: "error", error: resultArchive.error };
    } else if (type === "income") {
      const resultArchive = await archiveIncomePlan();
      if (resultArchive.status === "error")
        return { status: "error", error: resultArchive.error };
    } else {
      return { status: "error", error: new Error("The plan has an invalid type.") };
    }
    return { status: "success" };
  } catch (error) {
    return { status: "error", error: error instanceof Error ? error : new Error(`Error deleting item: ${String(error)}`) };
  }
};
